import "./App.css";
import Navbar from "./navbar.js";
import React, { Component } from "react";

class Calculator extends Component {
  render() {
    return (
      <div>
        <header>
          <Navbar />
        </header>
        <body className="mBody">
          <h1>Fan Calculator</h1>
          <h3>
            Enter your tiles and any qualifiers to calculate the points of your
            hand.
          </h3>
          <div
            className="frame"
            style={{
              overflow: "hidden",
              height: "85vh",
              width: "85vw",
            }}
          >
            <iframe
              src="https://mahjongsoft.com/calc.php"
              title="Website Page Title"
              // scrolling="no"
              style={{
                width: "100%",
                height: "100%",
                position: "relative",
                top: "-100px",
              }}
            ></iframe>
          </div>
        </body>
      </div>
    );
  }
}

export default Calculator;
